import '../Posts.css';

const PostUpdate = () => {
    return (
        <>
            <form className='form-update'>
                <div className='form-group'>
                    <textarea className='form-control content-update' id='content-update' name='content-update' rows='3'></textarea>
                </div>
                <div className='form-group text-right'>
                    <button type='submit' className='btn'>
                    <i className='bx bxs-edit-alt bx-flashing' style={{color:"#25dbf6"}} ></i> Update</button>
                    <button type='submit' className='btn'>
                    <i className='bx bx-exit bx-flashing' style={{color:"#25dbf6"}} ></i>Cancel</button>
                </div>
            </form>
        </>
    )
}
export default PostUpdate;
